import React from "react";
import "../../data/lodging.json";
import Lodging from "../../pages/lodging";

function Tags(lodging){
  const {tags} = props;
return (
    <div className="TagsElement">
        {Lodging.map((tag) => {
            const { tags } = tags;
            return (
                <p className="Tags-name">{lodging.tags}</p>
            )
        })}
    </div>
)
 }

export default Tags;
